CREATE TABLE `orders` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint unsigned DEFAULT NULL,
  `total_price` double NOT NULL COMMENT 'Сумма с учётом всех налогов и скидок',
  `currency_id` bigint unsigned DEFAULT NULL,
  `rate` double(8,2) NOT NULL DEFAULT '1.00',
  `note` varchar(191) DEFAULT NULL,
  `shop_id` bigint unsigned DEFAULT NULL,
  `tax` double NOT NULL DEFAULT '1',
  `commission_fee` double DEFAULT NULL,
  `status` varchar(255) NOT NULL DEFAULT 'new',
  `phone` varchar(255) DEFAULT NULL,
  `username` varchar(255) DEFAULT NULL,
  `delivery_fee` double NOT NULL DEFAULT '0',
  `deliveryman` bigint unsigned DEFAULT NULL,
  `delivery_date` date DEFAULT NULL,
  `delivery_time` varchar(255) DEFAULT NULL,
  `total_discount` int DEFAULT NULL,
  `delivery_type` varchar(255) NOT NULL DEFAULT 'pickup',
  `current` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `img` varchar(255) DEFAULT NULL,
  `address_id` bigint unsigned DEFAULT NULL,
  `waiter_id` bigint unsigned DEFAULT NULL,
  `table_id` bigint unsigned DEFAULT NULL,
  `booking_id` bigint unsigned DEFAULT NULL,
  `user_booking_id` bigint unsigned DEFAULT NULL,
  `waiter_fee` double NOT NULL DEFAULT '0',
  `tips` double NOT NULL DEFAULT '0' COMMENT 'Чаевые',
  `service_fee` double DEFAULT NULL,
  `address` text,
  `location` text,
  `small_order_fee` double(8,2) DEFAULT NULL,
  `cart_id` bigint unsigned DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `image_after_delivered` varchar(255) DEFAULT NULL,
  `otp` smallint DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `orders_currency_id_foreign` (`currency_id`),
  KEY `orders_shop_id_foreign` (`shop_id`),
  KEY `orders_deliveryman_index` (`deliveryman`),
  KEY `orders_address_id_foreign` (`address_id`),
  KEY `orders_waiter_id_foreign` (`waiter_id`),
  KEY `orders_user_id_foreign` (`user_id`),
  CONSTRAINT `orders_address_id_foreign` FOREIGN KEY (`address_id`) REFERENCES `user_addresses` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `orders_currency_id_foreign` FOREIGN KEY (`currency_id`) REFERENCES `currencies` (`id`) ON DELETE SET NULL,
  CONSTRAINT `orders_shop_id_foreign` FOREIGN KEY (`shop_id`) REFERENCES `shops` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `orders_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `orders_waiter_id_foreign` FOREIGN KEY (`waiter_id`) REFERENCES `users` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3957 DEFAULT CHARSET=utf8mb3;

